import React from "react";

const IssuesBoard = () => {
    return (
        <div>
            <p className='text-4xl font-bold pt-10'>Issues Tracker</p>
                <table className='table'>
                    <thead>
                        <tr>
                            <th>Type</th>
                            <th>Priority</th>
                            <th>Issue</th>
                            <th>Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {projectIssues.map((issue) => (
                            <tr key={issue.id}>
                                <th>{issue.type}</th>
                                <th>{issue.priority}</th>
                                <th>{issue.subject}</th>
                                <th>{issue.status}</th>
                            </tr>
                        ))}


                    </tbody>
                </table>
        </div>
    );
};

export default IssuesBoard;
